import React, { useEffect, useState } from 'react';
import axios from 'axios';
import PropertyCard from '../components/PropertyCard';

export default function Home() {
  const [listings, setListings] = useState([]);
  const [filters, setFilters] = useState({ location: '', minPrice: '', maxPrice: '', date: '' });

  const fetchListings = async () => {
    const params = {};
    if (filters.location) params.location = filters.location;
    if (filters.minPrice) params.minPrice = filters.minPrice;
    if (filters.maxPrice) params.maxPrice = filters.maxPrice;
    if (filters.date) params.date = filters.date;
    const res = await axios.get('http://localhost:5000/api/listings', { params });
    setListings(res.data);
  };

  useEffect(() => { fetchListings(); }, []); // initial load

  const handleChange = e => setFilters({ ...filters, [e.target.name]: e.target.value });
  const handleSearch = e => { e.preventDefault(); fetchListings(); };

  return (
    <div className="container">
      <h2 style={{ fontSize: '2.2rem', fontWeight: 700, marginBottom: 8, letterSpacing: '-1px', color: '#222' }}>Find Your Next Stay</h2>
      <div style={{ color: '#666', marginBottom: 32, fontSize: '1.1rem' }}>Browse beautiful places to stay, worldwide.</div>
      <form
        style={{
          display: 'flex',
          gap: 0,
          marginBottom: 36,
          alignItems: 'center',
          background: '#fff',
          borderRadius: 999,
          padding: 6,
          boxShadow: '0 4px 24px rgba(60,60,120,0.10)',
          border: '1.5px solid #e3e8f0',
          maxWidth: 700,
          marginLeft: 'auto',
          marginRight: 'auto',
          flexWrap: 'wrap',
        }}
        onSubmit={handleSearch}
      >
        <span style={{ display: 'flex', alignItems: 'center', padding: '0 18px', fontWeight: 500, fontSize: 16 }}>
          <span role="img" aria-label="location" style={{ marginRight: 6 }}>üìç</span>
          <input
            name="location"
            placeholder="Where to? (e.g. New York)"
            value={filters.location}
            onChange={handleChange}
            style={{
              border: 'none',
              outline: 'none',
              background: 'transparent',
              fontSize: 16,
              width: 130,
              padding: 0,
            }}
          />
        </span>
        <span style={{ height: 32, width: 1, background: '#e3e8f0', margin: '0 8px' }} />
        <span style={{ display: 'flex', alignItems: 'center', padding: '0 18px', fontWeight: 500, fontSize: 16 }}>
          <span role="img" aria-label="price" style={{ marginRight: 6 }}>üíµ</span>
          <input
            name="minPrice"
            type="number"
            placeholder="Min"
            value={filters.minPrice}
            onChange={handleChange}
            style={{ border: 'none', outline: 'none', background: 'transparent', fontSize: 16, width: 60, padding: 0 }}
          />
          <span style={{ margin: '0 4px', color: '#aaa' }}>-</span>
          <input
            name="maxPrice"
            type="number"
            placeholder="Max"
            value={filters.maxPrice}
            onChange={handleChange}
            style={{ border: 'none', outline: 'none', background: 'transparent', fontSize: 16, width: 60, padding: 0 }}
          />
        </span>
        <span style={{ height: 32, width: 1, background: '#e3e8f0', margin: '0 8px' }} />
        <span style={{ display: 'flex', alignItems: 'center', padding: '0 18px', fontWeight: 500, fontSize: 16 }}>
          <span role="img" aria-label="calendar" style={{ marginRight: 6 }}>üìÖ</span>
          <input
            name="date"
            type="date"
            value={filters.date}
            onChange={handleChange}
            style={{ border: 'none', outline: 'none', background: 'transparent', fontSize: 16, width: 130, padding: 0 }}
          />
        </span>
        <button
          type="submit"
          style={{
            background: 'linear-gradient(90deg, #1976d2 60%, #63b3ed 100%)',
            color: '#fff',
            border: 'none',
            borderRadius: 999,
            padding: '0.7rem 2.2rem',
            fontWeight: 700,
            fontSize: 18,
            marginLeft: 12,
            cursor: 'pointer',
            boxShadow: '0 2px 8px rgba(25,118,210,0.10)',
            transition: 'background 0.2s, box-shadow 0.2s',
          }}
        >
          <span role="img" aria-label="search">üîç</span> Search
        </button>
      </form>
      <div className="property-list">
        {listings.length === 0 ? (
          <div style={{ color: '#888', fontSize: '1.2rem', padding: '2rem', textAlign: 'center', width: '100%' }}>
            No properties found. Try adjusting your filters.
          </div>
        ) : (
          listings.map(listing => <PropertyCard key={listing._id} listing={listing} />)
        )}
      </div>
    </div>
  );
}
